function roundString (rounds) {
  var roundArr = rounds.reduce(function(arr, value, index) {
    if(value == true){ arr.push(index) }
    return arr;
  }, []);

  return roundArr.join(',');
}

var app = new Vue({
  el: '#app',
  data: {
    active_a: [false, true, true, false, false, false, false, false],
    active_b: [true, false, false, true, true, true, true, true],
    active_stat: 'touchdowns',
    active_team_a: 'ALL',
    active_team_b: 'ALL',
    show_teams_a: false,
    show_teams_b: false,
    show_stats: false,
    top_stat: 560,
    color_a: 'red',
    color_b: 'blue',
    teams: ['ALL', 'ARI', 'ATL', 'BAL', 'BUF', 'CAR', 'CHI', 'CIN', 'CLE', 'DAL', 'DEN', 'DET', 'GB', 'HOU', 'IND', 'JAC', 'KC', 'STL', 'SD', 'MIA', 'MIN', 'NE', 'NO', 'NYG', 'NYJ', 'OAK', 'PHI', 'PIT', 'SEA', 'SF', 'TB', 'TEN', 'WAS'],
    colors: {
      red: '#F44336',
      blue: '#2196F3',
      lightblue: '#03A9F4',
      gold: '#FFC107',
      green: '#4CAF50',
      aqua: '#009688',
      purple: '#673AB7',
      orange: '#FF6D00',
      black: '#000000',
      bluegrey: '#607D8B'
    },
    players: []
  },
  created: function() {
    var _this = this;

    var url = new URL(window.location.href);
    var team_a = url.searchParams.get("team_a");
    if(team_a){
      this.setTeam('a', team_a);
    }
    var team_b = url.searchParams.get("team_b");
    if(team_b){
      this.setTeam('b', team_b);
    }
    var rounds_a = url.searchParams.get("rounds_a");
    if(rounds_a){
      _this.active_a = [false, false, false, false, false, false, false, false];
      rounds_a.split(',').map(function(round){
        _this.active_a[round] = true;
      });
    }
    var rounds_b = url.searchParams.get("rounds_b");
    if(rounds_b){
      _this.active_b = [false, false, false, false, false, false, false, false];
      rounds_b.split(',').map(function(round){
        _this.active_b[round] = true;
      });
    }
    var stat = url.searchParams.get("stat");
    if(stat){
      _this.active_stat = stat;
    }
  },
  methods: {
    getPlayers: function(rounds, group) {
      var active_team = this['active_team_'+group];
      return this.players.filter(function (player) {
        if (active_team != 'ALL'){
          return rounds.includes(player.round) && active_team == player.team;
        }

        return rounds.includes(player.round);
      });
    },
    sumStat: function(group) {
      var peeps = this.sortPlayers(group);
      var stat = this.active_stat;

      return peeps.reduce(function(sum, player) {
        return sum + player[stat];
      }, 0);
    },
    sortPlayers: function(group) {
      var stat = this.active_stat;
      var rounds = [];
      for(var i=0;i<this['active_'+group].length;i++){
        if(this['active_'+group][i]){ rounds.push(i) }
      }

      var peeps = this.getPlayers(rounds, group);
      return peeps.sort(function(a, b) {
        return b[stat] - a[stat];
      });
    },
    setActiveStat: function(stat) {
      this.active_stat = stat;
      this.setTopStat();
    },
    setTopStat: function() {
      var sort_a = this.sortPlayers('a')[0];
      var sort_b = this.sortPlayers('b')[0];


      //if (sort_a && sort_b){
        var top_a = (sort_a || 0) && sort_a[this.active_stat];
        var top_b = (sort_b || 0) && sort_b[this.active_stat];
        var top;

        if (top_a > top_b){
          top = top_a;
        }else{
          top = top_b;
        }

        this.top_stat = top - (top % 10) + 10;

        console.log(roundString(this.active_a));

        var url = new URL(window.location.href);
        url.searchParams.set("team_a", this.active_team_a);
        url.searchParams.set("team_b", this.active_team_b);
        url.searchParams.set("rounds_a", roundString(this.active_a));
        url.searchParams.set("rounds_b", roundString(this.active_b));
        url.searchParams.set("stat", this.active_stat);

        url.href = url.href.replace(/%2C/g, ',');
        window.history.pushState({}, "", url);
      //}

      //_this.setTopStat();
      //url.searchParams.set("f", "NEW");
      //window.history.pushState({}, "", url);
      //window.location.href = url;
    },
    setRound: function(group, round) {
      var active = this['active_'+group][round];
      this['active_'+group][round] = !active;
      this.setTopStat();
    },
    setTeam: function(group, team) {
      this['active_team_'+group] = team;

      this['color_'+group] = teamColors[team][0];
      if(this.color_a == this.color_b){
        this['color_'+group] = teamColors[team][1];
      }

      this.setTopStat();
    }
  },
  computed: {
    firstRound: function() {
      return this.players.filter(function (player) {
        return player.round == 1
      })
    },
    secondRound: function() {
      return this.players.filter(function (player) {
        return player.round == 2
      })
    },
    touchdowns: function() {
      return this.players.reduce(function(sum, player) {
        return sum + player.touchdowns;
      }, 0);
    }
  }
});

